(function(e) {
    "use strict";
    e(function() {
        e(".menu-top > .wp-menu-image").tooltip({
            title: function() {
                e(this).find("span > span").removeClass().addClass("badge");
                var t = e(this).siblings(".menu-top").html();
                return t;
            },
            placement: "right",
            html: "true"
        });
    });
})(jQuery);